    <>
      <Main_navbar/>
      {/* <Login /> */}
      {/* <Cadastro /> */}
      {/* <Contact /> */}
      {/* <Main/> */}
      {/*<Sales />*/}
      <Menu products={products} />
      <Footer />
    </>
  );
}

export default App;
